angular.module("myApp",["ngAnimate"]).controller("DisplayController",function(t){t.$on("displayData",function(n,i){t.content=i})}).controller("MultiplicationController",function(t,n,i){function c(t){for(var n=[],i=0;t>i;i++)n[i]=i+1;return n}t.compute=function(t,n){return t*n},t.$watch("numberLimit",function(n){t.numbers=c(n)}),t.numberLimit=n.initialNumberLimit||10,t.activeFactors=[],t.setActiveFactors=function(n,i){t.activeFactors[0]=n,t.activeFactors[1]=i},t.matchesFactor=function(n,i){return n===t.activeFactors[0]||i===t.activeFactors[1]},t.setActiveNumber=function(t){i.$broadcast("displayData",t)}});